import React, { Component } from 'react';
import "./Enemy.css";

class Enemy extends Component {
    constructor(props) {
        super(props);
        const enemyHP = this.stats.value[2]*10;
        this.stats.value[1] = enemyHP;
        this.state = {
            enemyCurrentStats: this.stats,
            enemyHP
        }
    }

    render() {
        return (
            <div>
            <div className="enemy-items__container">
                {this.props.items.map((item, index) =>
                    <img className={item.zip} key={`enemy-items-${index}`} src={item.src} alt={item.name}/>
                )}
            </div>
            <div className="enemy-stats__container">
            {this.props.stats.map((text, value, index) =>
                    <label key={`enemy-items-${index}`}> {text}: {value}
                    </label>
            )}
            </div>
            </div>
        );
    }
}

export default Enemy;
